import React from 'react';

const FlagRo = props => (
  <svg viewBox="0 0 3 2" {...props}>
    <path fill="#002B7F" d="M0 0h1v2H0z" />
    <path fill="#FCD116" d="M1 0h1v2H1z" />
    <path fill="#CE1126" d="M2 0h1v2H2z" />
  </svg>
);

export default FlagRo;
